        private string Encabezados_clases(int id_clase)
        {
            string rpt = "";
            switch (id_clase)
            {
                //1
                case int n when (n == 1):
                    rpt = "Autos";
                    StrLinea = id_clase.ToString();
                    break;

                //2, 3, 4, 5, 6, 7, 8, 9
                case int n when (n >= 2 && n <= 9):
                    rpt = "Camiones";
                    StrLinea = id_clase.ToString();
                    break;

                //12, 13, 14
                case int n when (n >= 12 && n <= 14):
                    rpt = "Autobuses";
                    StrLinea = Convert.ToString(id_clase).Substring(1, 1);
                    break;
                case 15:
                    rpt = "Motos";
                    StrLinea = id_clase.ToString();
                    break;
                //10, 11, 17
                //&& n == 11 && n == 17
                case int n when (n == 10 || n == 11 || n == 17):
                    rpt = "Ejes Excedentes";
                    //strLinea = id_clase
                    StrLinea = "EE1";
                    break;
                //16, 18
                case int n when (n == 16 || n == 18):
                    rpt = "Ejes Excedentes";
                    //strLinea = id_clase
                    StrLinea = "EE2";
                    break;
            }

            return rpt;
        }

